INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(27, 'Category Empty Collection', 'category_empty_collection', '<h1 class="center">There are no products matching the selection.</h1>\r\n<p class="center">Hey! We are almost here; we are filling each category. We''ll be glad if you could check back soon.</p>\r\n			\r\n			', '2016-05-01 06:57:34', '2016-05-01 10:53:22', 1),
(28, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button.</p>\n			\n			', '2016-05-01 06:57:34', '2016-05-01 06:57:34', 1),
(29, 'Footer Links', 'footer_links', '<ul>\r\n      <li><a href="{{store direct_url="faq"}}">FAQ</a></li>\r\n      <li><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy</a></li>\r\n      <li><a href="{{store direct_url="terms-and-conditions"}}">Terms and Conditions</a></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:34', '2016-06-16 16:07:39', 1),
(30, 'Footer Links Company', 'footer_links_company', '<div class="links">\r\n    <div class="block-title">\r\n        <strong><span>Company</span></strong>\r\n    </div>\r\n    <ul>\r\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\r\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\r\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\r\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\r\n    </ul>\r\n</div>\r\n			\r\n			', '2016-05-01 06:57:34', '2016-05-01 10:48:08', 0),
(31, 'Footer Top Left', 'footer_top_left', 'You can replace default Newsletter Subscribe Form with this block: "footer_top_left"\r\n			\r\n			', '2016-05-01 06:57:34', '2016-05-01 10:44:04', 0),
(32, 'Footer Top Right', 'footer_top_right', '<a href="#" title="Connect with Us on Google+" class="icon-googleplus">Connect with Us on Google+</a>\r\n<a href="#" title="Connect with Us on Pinterest" class="icon-pinterest">Connect with Us on Pinterest</a>\r\n<a href="#" title="Connect with Us on YouTube" class="icon-youtube">Connect with Us on YouTube</a>\r\n<a href="#" title="Connect with Us on Instagram" class="icon-instagram">Connect with Us on Instagram</a>\r\n<a href="#" title="Connect with Us on LinkedIn" class="icon-linkedin">Connect with Us on LinkedIn</a>\r\n<a href="#" title="Connect with Us on Twitter" class="icon-twitter">Connect with Us on Twitter</a>\r\n<a href="#" title="Connect with Us on Facebook" class="icon-facebook">Connect with Us on Facebook</a>\r\n			\r\n			', '2016-05-01 06:57:34', '2016-05-01 10:44:13', 0),
(33, 'Footer Main - First Column', 'footer_main_first_column', '<ul>\r\n      <li class="title">Company</li>\r\n      <li><a href="#">About Us</a></li>\r\n      <li><a href="#">Careers</a></li>\r\n      <li><a href="#">Press Releases</a></li>\r\n      <li><a href="#">Investors</a></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:34', '2016-05-01 10:44:42', 0),
(34, 'Footer Main - Second Column', 'footer_main_second_column', '<ul>\r\n      <li class="title">Customer Service</li>\r\n      <li><a href="#">FAQ</a></li>\r\n      <li><a href="{{store direct_url="sales/guest/form/"}}">Orders &amp; Returns</a></li>\r\n      <li><a href="#">Shipping Rates &amp; Policies</a></li>\r\n      <li><a href="#">International Shipping</a></li>\r\n      <li><a href="{{store direct_url="contacts"}}">Contact Us</a></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:35', '2016-05-01 10:44:53', 0),
(35, 'Footer Main - Third Column', 'footer_main_third_column', '<ul>\r\n      <li class="title">Your Account</li>\r\n      <li><a href="{{store direct_url="sales/order/history"}}">Your Orders</a></li>\r\n      <li><a href="{{store direct_url="wishlist"}}">Your Wishlist</a></li>\r\n      <li><a href="#">Payment Methods</a></li>\r\n      <li><a href="#">Newsletter</a></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:35', '2016-05-01 10:45:04', 0),
(36, 'Footer Main - Fourth Column', 'footer_main_fourth_column', '<ul>\r\n      <li class="title">Contact Us</li>\r\n      <li class="icon-mapmarker">10441 Jefferson Blvd Suite 200, Culver City CA 90232 USA</li>\r\n      <li class="icon-phone">+001 555 801</li>\r\n      <li class="icon-email-2"><a href="mailto:sales@example.com">sales@example.com</a></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:35', '2016-05-01 10:45:13', 0),
(37, 'Footer for Mobile', 'footer_for_mobile', '<li><a href="{{store url=''checkout/cart''}}">Cart (<span class="highlighted">{{widget type="itactica_intenso/widget_view"}}</span>)</a></li>\r\n<li><a href="{{store url=''customer/account''}}">Your Account</a></li>\r\n<li><a href="{{store url=''wishlist''}}">Your Wish List</a></li>\r\n<li><a href="#">Company</a></li>\r\n<li><a href="#">Customer Service</a></li>\r\n<li><a href="{{store url=''privacy-policy-cookie-restriction-mode''}}">Privacy &amp; Terms</a></li>\r\n			\r\n			', '2016-05-01 06:57:35', '2016-05-01 10:45:57', 1),
(38, 'Footer Bottom Right', 'footer_bottom_right', '<ul class="payment-logos">\r\n      <li><img src="{{media url="theme/logo-paypal.svg"}}" alt="PayPal" title="PayPal" /></li>\r\n      <li><img src="{{media url="theme/logo-visa.svg"}}" alt="Visa" title="Visa" /></li>\r\n      <li><img src="{{media url="theme/logo-discover.svg"}}" alt="Discover" title="Discover" /></li>\r\n      <li><img src="{{media url="theme/logo-amex.svg"}}" alt="American Express" title="American Express" /></li>\r\n      <li><img src="{{media url="theme/logo-mastercard.svg"}}" alt="Mastercard" title="Mastercard" /></li>\r\n      <li><img src="{{media url="theme/logo-maestro.svg"}}" alt="Maestro" title="Maestro" /></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:35', '2016-05-01 10:45:26', 0),
(39, 'Mini Cart Promotion', 'mini_cart_promotion', '<h6>Free Ground Shipping</h6>\r\n<p class="small">(Place your promotion here)</p>\r\n			\r\n			', '2016-05-01 06:57:35', '2016-05-01 10:49:35', 0),
(40, 'Main Menu Custom Dropdown Block', 'main_menu_custom_dropdown', '<ul class="links-list">\n      <li>\n            <a href="#">Custom Item 1</a>\n      </li>\n       <li>\n            <a href="#">Custom Item 2</a>\n      </li>\n      <li>\n            <a href="#">Custom Item 3</a>\n      </li>\n</ul>\n			\n			', '2016-05-01 06:57:35', '2016-05-01 06:57:35', 1),
(41, 'Product View - Block 1', 'product_view_block_1', '			Inactive', '2016-05-01 06:57:35', '2016-05-02 13:04:06', 0),
(42, 'Product View - Block 2', 'product_view_block_2', '<a href="#"><img src="{{media url="theme/product-view-static-block.jpg"}}" width="300" height="250" alt="Put your Static Block here."></a>\r\n<div class="advertisement">Advertisement</div>\r\n			\r\n			', '2016-05-01 06:57:36', '2016-05-02 13:04:24', 0),
(43, 'Product View - Custom Info', 'product_view_block_3', '<p>This is a custom CMS block. You can use it to display information about shipping, returns, refunds, latest promotions etc. Put any content you want here, like text, HTML or images. There are many useful blocks like this one across the theme. All CMS blocks are editable from the admin panel.</p>\r\n<p><span class="label">Shipping: </span>Please allow about 5-10 business days for delivery. For delivery to Alaska or Hawaii, please allow 10-15 days for delivery. For delivery to PO Boxes in Alaska, Hawaii, US Territories and APO/FPO addresses, allow three weeks for delivery.</p>\r\n<p><span class="label">Backorders: </span>All backordered items will be shipped via Standard Delivery service at no additional charge.</p>\r\n<p><span class="label">Returns Policy: </span>You may return new, unworn or unused products within thirty (30) days of delivery for a full refund of the cost of the goods, or an exchange if preferred.</p>\r\n			\r\n			', '2016-05-01 06:57:36', '2016-05-02 13:04:41', 0),
(44, 'Shopping Cart - Block 1', 'shopping_cart_block_1', '<img src="{{media url="theme/banner-shopping-cart.jpg"}}" width="1200" height="140" alt="This is a Static Block. You can put any content here.">\r\n			\r\n			', '2016-05-01 06:57:36', '2016-05-02 13:04:59', 0),
(45, 'Contact Page', 'contact_page', '<h4>Custom Static Block</h4>\r\n<br />\r\n<span><strong>Corporate Address</strong><br /><br />\r\n10441 Jefferson Blvd Suite 200, Culver City CA 90232 USA</span>\r\n<br />\r\n<br />\r\n<br />\r\n<span><strong>Frequently Requested Info</strong></span>\r\n<br />\r\n<br />\r\n<ul class="no-bullets">\r\n     <li><a href="#">Orders & Returns</a></li>\r\n     <li><a href="#">Shipping Rates & Policies</a></li>\r\n     <li><a href="#">FAQ</a></li>\r\n     <li><a href="#">International Shipping</a></li>\r\n</ul>\r\n			\r\n			', '2016-05-01 06:57:36', '2016-05-01 10:47:35', 0),
(46, 'RSS Feed', 'rss_feed', '<h4>Custom Static Block</h4>\n<p><strong>Put any content here</strong></p>\n<p>Insert your own content here: plain text, HTML, images or whatever you like. Intenso has many similar content placeholders across the store. You can edit this block from the backend: CMS -> Static Blocks -> RSS Feed.</p>\n			\n			', '2016-05-01 06:57:36', '2016-05-01 06:57:36', 1),
(47, 'Exit Intent Pop-up', 'exit_intent_popup', '<br><br>\r\n<h2 style="color: #27ccc0">Before you Leave!</h2>\r\n<h4 style="color: #777777">Sign Up for exclusive updates, new arrivals and insider-only discounts</h4>\r\n<br><br>\r\n{{block type="newsletter/subscribe" name="newsletter" template="newsletter/popup-subscribe.phtml"}}\r\n<br><br>\r\n<div class="social">\r\n    <a href="#" title="Connect with Us on Facebook" class="icon-facebook">Connect with Us on Facebook</a>\r\n    <a href="#" title="Connect with Us on Twitter" class="icon-twitter">Connect with Us on Twitter</a>\r\n    <a href="#" title="Connect with Us on LinkedIn" class="icon-linkedin">Connect with Us on LinkedIn</a>\r\n    <a href="#" title="Connect with Us on Instagram" class="icon-instagram">Connect with Us on Instagram</a>\r\n    <a href="#" title="Connect with Us on YouTube" class="icon-youtube">Connect with Us on YouTube</a>\r\n    <a href="#" title="Connect with Us on Pinterest" class="icon-pinterest">Connect with Us on Pinterest</a>\r\n    <a href="#" title="Connect with Us on Google+" class="icon-googleplus">Connect with Us on Google+</a>\r\n</div>\r\n<br><br><br>\r\n			\r\n			', '2016-05-01 06:57:36', '2016-05-01 10:52:06', 0),
(48, 'Layered Nav Top Block', 'layered_nav_top_block', 'If this block is enabled, its content is shown in the top section of the Layered Navigation pane.\n			', '2016-05-01 06:57:36', '2016-05-01 06:57:36', 0),
(49, 'Layered Nav Bottom Block', 'layered_nav_bottom_block', 'If this block is enabled, its content is shown in the bottom section of the Layered Navigation pane.\n			', '2016-05-01 06:57:36', '2016-05-01 06:57:36', 0);
