(17, '404 Not Found', 'no_route_custom', NULL, NULL, 'no-route', NULL, '<h1 class="center">Oops, this page isn''t here</h1>\n    <p class="center">The URL may be misspelled or the page you''re looking for is no longer available.</p>\n    			\n    			', '2016-05-01 06:57:33', '2016-05-01 06:57:33', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy-cookie-restriction-mode', NULL, '<div class="custom_full">\r\n<div class="row other-pages">\r\n<div class="small-12 medium-12 large-12 columns">\r\n<div class="page-title">\r\n<h1>Privacy Policy</h1>\r\n</div>\r\n<p>At Sweet sensation Confectionery, we strive to do everything we can to respect the trust customers have in our brand and our commitment to your privacy is no exception. &nbsp;We are committed to protecting and safeguarding the privacy of visitors to our Web sites, including mobile Web sites, ("Sites") and users of our mobile device applications ("Mobile Apps"), especially for children.<br /> <br />This Privacy Policy describes the types of personal information we collect from visitors to our Sites and users of our Mobile Apps (collectively, "Online Services"). &nbsp;The Policy also sets forth how we use this information, provides other details about our personal information practices, and explains how to contact us if you have any questions or concerns.</p>\r\n<ol>\r\n<li>Types of Information We Collect and How It Is Used</li>\r\n<li>Sharing of Personal Information</li>\r\n<li>Children&rsquo;s Privacy Notice</li>\r\n<li>Access</li>\r\n<li>Cookies</li>\r\n<li>Targeted Advertising</li>\r\n<li>Changes to our Privacy Policy</li>\r\n<li>How to Contact Us</li>\r\n</ol>\r\n<p><a href="http://www.mcdonalds.com/content/us/en/privacy.html#11"><br /> </a><b>1. Types of Information We Collect and How It Is Used</b></p>\r\n<p><b><i>Information You Give Us.</i></b></p>\r\n<p>Sweet sensation only gathers personal information, such as, first and last names, addresses and email addresses, when voluntarily submitted by you. &nbsp; For example, personal information may be collected from you in order to get your feedback on our Online Services and our products or to enter you in one of our contests or sweepstakes. &nbsp; You may choose not to provide the requested information, but in that event the Site or Mobile App may not function correctly or certain functions may not be available.</p>\r\n<p>In addition, when you visit our Web Sites or Mobile Apps, we may collect certain information by automated means. &nbsp;The information we collect may include your Internet Protocol (IP) address, computer/mobile device operating system and browser type, type of mobile device, the unique device identifier (UDID) or mobile equipment identifier (MEID) for your mobile device, the address of a referring web site (if any), and the pages you visit on our Web Sites. &nbsp; We may use this information to operate, maintain, and manage our Online Services and to provide services such as technical support. &nbsp; We provide additional information regarding our use of "cookies" in this Privacy Policy below.</p>\r\n<p><b><i>Mobile Devices and Location Information.</i></b></p>\r\n<p>Mobile Apps and mobile versions of our Sites may collect precise information about the location of your mobile device using location awareness technologies such as GPS, Wi-Fi, Bluetooth or cell tower proximity. &nbsp; Sweet sensation uses this information for location-based services that you request such as locating nearby Sweet sensation restaurants or identifying special offers that may be of interest to you, or personalizing your interactions with Sweet sensation. &nbsp; For most mobile devices, you are able to withdraw your permission for Sweet sensation to acquire this information on your location through the device settings. &nbsp; If you have questions about how to disable your mobile device''s location services, we recommend you contact your mobile device service provider or the device manufacturer. &nbsp; If you would like us to delete location information we have collected, please contact us at the email or postal address listed below. &nbsp; Please note that the applications may not function properly following deletion, and that we may be required by law to retain certain information.</p>\r\n<p><b>2. Sharing of Personal Information</b></p>\r\n<p>Occasionally, with your permission, we will send marketing information to you, such as discount coupons, information about new product offerings, etc.&nbsp; If you do not elect to receive such materials, we will not send them to you. &nbsp;</p>\r\n<p>Companies may be engaged by Sweet sensation to perform a variety of functions, such as, fulfilling orders, assisting with promotions, providing technical services for our Sites.&nbsp; These companies may have access to personal information if needed to perform such functions.&nbsp; However, these companies may only use such personal information for the purpose of performing that function and may not use it for any other purpose.</p>\r\n<p>Sweet sensation does not sell, transfer or disclose personal information to third parties outside Sweet sensation.&nbsp; However, with your permission, we will, on occasion send marketing information on behalf of one of our business partners about products or services they provide that may be of interest to you.&nbsp; You may be asked if you wish to receive marketing materials from Sweet sensation business partners.&nbsp; If you elect to receive such materials, Sweet sensation will not share your personal information with such partners but rather will send a mailing or e-mail on behalf of the partners.</p>\r\n<p>Sweet sensation reserves the right to use or disclose any information as needed to satisfy any law, regulation or legal request, to protect the integrity of the Online Service, to fulfill your requests, or to cooperate in any law enforcement investigation or an investigation on a matter of public safety.</p>\r\n<p>&nbsp;</p>\r\n<p><b>3. Children''s Privacy Notice</b></p>\r\n<p>Sweet sensation understands the importance of privacy to visitors to and users of our Online Services. &nbsp; We are especially committed to protecting the privacy of children who visit or use our Online Services. &nbsp; This Children''s Privacy Notice is designed to answer your questions regarding our practices with respect to personal information we collect through our Online Services from children under the age of 13.<br /> <br /> <b><i>What Personal Information Does Sweet sensation Collect?</i></b></p>\r\n<p>We offer many features on our Sites, like games and coloring books, which do not require a child to provide any personal information. &nbsp;On occasion, however, we may collect personal information, such as an email address from children as part of an activity.&nbsp; For example:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; We may collect a child''s email address to notify the child if he or she has won or lost a contest or sweepstakes.&nbsp; In that event, we will notify the child using the email address the child supplies.&nbsp; We will not keep the address or use it for any other purpose.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; We may collect a child''s email address in order to respond to a request from the child on a one-time basis, such as to send the child a screen saver. In this case we promptly delete the email address from our system once we have responded, and we do not use the address for any other purpose.</p>\r\n<p>We will not collect other personal information from a child under the age of 13, such as a postal address or telephone number, without the consent of a parent or guardian. If parent or guardian consent is required we will collect the email address of the parent or guardian so we can provide notice of our information practices and/or seek the parent''s or guardian''s consent. &nbsp;</p>\r\n<p>Sweet sensation will not condition a child''s participation in any online activity on the child''s disclosure of more personal information than is reasonably necessary to participate in that activity.</p>\r\n<p><b><i>How Does McDonald''s Use the Personal Information It Collects?</i></b><br /> <br />We use email addresses submitted by a child in order to respond to the child''s request or to notify the child if he or she has won or lost a contest or sweepstakes they entered.&nbsp; We use the email address of a parent or guardian, in order to provide the parent notice of our information practices or to seek the parent''s or guardian''s consent.</p>\r\n<p><b><i>How Does Sweet sensation Share Personal Information?</i></b><br /> <br />We may share a child''s personal information with third parties to the extent reasonably necessary to protect the security or integrity of our Online Services, take precautions against liability, or respond to judicial process or requests from other governmental authorities; or when we believe disclosure is necessary or appropriate to prevent physical harm or financial loss, or in connection with an investigation of suspected or actual illegal activity.</p>\r\n<p>We also may share personal information collected from children with vendors that perform services for Sweet sensation.&nbsp; These services may include hosting our Sites, providing technical services to Sweet sensation, fulfilling requests or administering sweepstakes. Such vendors are obligated to protect the confidentiality of the personal information we share with them.</p>\r\n<p><b><i>Requests from Parents Regarding Our Children''s Privacy Practices</i></b><br /> <br />Parents may review personal information we have collected from their child that has not been deleted, and can request that the personal information be deleted from our records if it has not been already.&nbsp; Parents also may refuse to permit further collection or use of their child''s personal information, when the parent has previously provided consent.&nbsp; To do so, please contact us at the address, telephone number or email address provided below with your request.</p>\r\n<p><b><i>Who Should I Contact with Questions?</i></b><br /> <br />We urge parents to regularly monitor and supervise their children''s online activities.&nbsp; If you have any questions about our Children''s Privacy Notice, please contact us at:</p>\r\n<p>Privacy at Sweet sensation .com<br />marketing dept.<br />3, opebi road. Opebi Ikeja<br />Lagos State<br />0805 2090 025<br />or e-mail us at <a href="mailto:info@sweetsensation.com">info@sweetsensation.com</a></p>\r\n<p>&nbsp;<br /> <b>4. Access</b></p>\r\n<p>You are in control of any personal information you provide to us through our Online Services.&nbsp; If at any time, you would like to correct the personal information we have about you or if you would like to change your preferences for contacts from us or on behalf of our business partners, you can let us know by contacting us at the email or postal address listed below.</p>\r\n<p>&nbsp;</p>\r\n<p><b>5. Cookies</b></p>\r\n<p>A "cookie" is a text file that websites send to a visitor''s computer or other Internet-connected device to uniquely identify the visitor''s browser or to store information or settings in the browser. &nbsp; Like most websites, Sweet sensation uses cookies for a variety of purposes in order to improve your online experience. &nbsp;For example, we track the total number of visitors to our Sites on an anonymous aggregate basis. &nbsp;We may also employ cookies so that we remember you when you return to the Site, to keep track of the items in your shopping cart if you purchase merchandise online, to administer certain contests and sweepstakes and to help customize your Sweet sensation web experience. &nbsp; We may associate personal information with a cookie file in those instances. &nbsp; Both we and others (such as out advertising networks) may collect personal information about our visitors&rsquo; online activities, overtime and across third-party websites, when using our Online services.</p>\r\n<p>Use the options in your web browser if you do not wish to receive a cookie or if you wish to set your browser to notify you when you receive a cookie. Click on the &ldquo;Help&rdquo; section of your browser to learn how to change your cookie preferences.&nbsp; If you disable all cookies, you may not be able to take advantage of all the features of this Site.</p>\r\n<p>&nbsp;</p>\r\n<p><b>6. Targeted Advertising</b></p>\r\n<p>On our Online Services, we may collect information about your online activities for use in providing you with advertising tailored to your individual interests. &nbsp; This section of our Privacy Policy provides details and explains how to exercise your choices.</p>\r\n<p>You may see certain ads on other websites because we participate in advertising networks. &nbsp;Ad networks allow us to target our messaging to users through demographic, interest-based and contextual means. &nbsp;These networks track your online activities over time by collecting information through automated means, including through the use of cookies, web server logs, web beacons and other technologies. &nbsp;The networks use this information to show you advertisements that may be tailored to your individual interests.&nbsp;The information our ad networks may collect includes information about your visits to websites that participate in the relevant advertising networks, such as the pages or advertisements you view and the actions you take on the websites. &nbsp;This data collection takes place both on our Online Services and on third-party websites that participate in the ad networks. &nbsp;This process also helps us evaluate our marketing efforts.&nbsp;You can opt out of delivery of targeted advertising to you by multiple companies by visiting:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; <a href="http://www.aboutads.info/choices" target=" _blank;">www.aboutads.info/choices,</a></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; <a href="http://www.networkadvertising.org/managing/opt_out.asp" target=" _blank;">www.networkadvertising.org/managing/opt_out.asp</a> or,</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; <a href="http://www.evidon.com/" target=" _blank;">www.evidon.com.</a></p>\r\n<p>Please note that even if you opt out, you will continue to receive advertisements, but they will not be tailored to your specific interests.</p>\r\n<p>&nbsp;</p>\r\n<p><b>7. Changes to our Privacy Policy</b></p>\r\n<p>This Privacy Policy is effective as of June 20, 2016. &nbsp; From time to time, it may be necessary for Sweet sensation to change this Privacy Policy. &nbsp; If we change our policy, we will post the revised version here, so we suggest that you check here periodically for the most up-to-date version of our Privacy Policy. &nbsp; Rest assured, however, that any changes will not be retroactively applied and will not alter how we handle previously collected information.</p>\r\n<p>&nbsp;</p>\r\n<p><b>8. How to Contact Us</b></p>\r\n<p>Privacy at Sweet sensensation<br />Marketing Dept.<br />3, opebi road<br />Opebi ikeja, Lagos<br />0805 2090 025<br />or e-mail us at</p>\r\n<p><a href="mailto:info@sweetsensation.com">info@sweetsensation.com</a></p>\r\n</div>\r\n</div>\r\n</div>', '2016-05-01 06:57:33', '2016-06-16 16:07:58', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
