 not involved in the operation of this site. Information submitted via a number of areas in this site, for instance, Write to Ronald, is not retained. Therefore, the above right to use Submissions is subject to this limited use of this information and excludes non-retained information. You acknowledge that you are responsible for whatever material you submit, and you, not Sweet sensation have full responsibility for the message, including its legality, reliability, appropriateness, originality, and copyright.</p>\r\n<p><b>JURISDICTION</b></p>\r\n<p>Except as described otherwise, all materials in the Sweet sensation site are made available only to provide information about Sweet sensation. Sweet sensation controls and operates this site from its headquarters in Opebi Ikeja, Lagos state Nigeria and makes no representation that these materials are appropriate or available for use in other locations. If you use this site from other locations you are responsible for compliance with applicable local laws. &nbsp;If you download or use the Software, you represent and warrant that you are not located in, or under the control of, or a national or any such country or on any such list.</p>\r\n<p><b>DISCLAIMER</b></p>\r\n<p>The material in this site could include technical inaccuracies or typographical errors. Sweet sensation may make changes or improvements at any time. THE MATERIALS IN THIS SITE ARE PROVIDED "AS IS" AND WITHOUT WARRANTIES OF ANY KIND EITHER EXPRESSED OR IMPLIED, TO THE FULLEST EXTENT PERMISSIBLE PURSUANT TO APPLICABLE LAW. SWEET SENSATION DISCLAIMS ALL WARRANTIES OR MERCHANTABILITY AND FITNESS FOR A PARTICULAR PURPOSE. SWEET SENSATION DOES NOT WARRANT THAT THE FUNCTIONS CONTAINED IN THE MATERIAL WILL BE UNINTERRUPTED OR ERROR-FREE, THAT DEFECTS WILL BE CORRECTED, OR THAT THIS SITE OR THE SERVER THAT MAKES IT AVAILABLE ARE FREE OF VIRUSES OR OTHER HARMFUL COMPONENTS. SWEET SENSATION DOES NOT WARRANT OR MAKE ANY REPRESENTATIONS REGARDING THE USE OF OR THE RESULT