t sensation can revise these Terms and Conditions at any time by updating this posting. Sweet sensation products and services are available in many parts of the world. However, the Sweet sensation site may describe products and services that are not available worldwide. This site may be linked to other sites which are not maintained by Sweet sensation. Sweet sensation is not responsible for the content of those sites. The inclusion of any link to such sites does not imply endorsement by Sweet sensation of the sites.</p>\r\n<p><b>McDonald''s Customer E-mail Center Terms and Conditions</b></p>\r\n<p>Hours of Service for Sweet sensation Customer E-mail Center: Monday through Friday, 8:30 am to 5:00 pm Central Time.</p>\r\n<p>Submission of Ideas: Sweet sensation values customer feedback. However, Sweet sensation will not accept or consider unsolicited ideas, suggestions, or materials, so we must ask you not to send us your ideas for our business. We hope that you understand that it is the intent of this policy to avoid the possibility of future misunderstandings when products or other Sweet sensation promotions or initiatives developed by Sweet sensation professional staff might seem to others similar to their own creative work.</p>\r\n<p>If, despite this request, you send us suggestions or ideas ("Submissions"), the Submissions shall be deemed to have been submitted voluntarily and shall remain the property of Sweet sensation confectionery. Subject only to the limitations set forth in Sweet sensation Privacy Policy, Sweet sensation shall have the right to copy, distribute, transmit, perform, display, modify, adapt, and otherwise use your Submission for any purpose whatsoever (including, without limitation, in the development, manufacture and marketing of products and services based on or incorporating ideas, know-how and techniques contained in your Submission), in all forms and media (including, without limitation, by means of the Internet or other electronic media) throughout the world. Sweet sensation shall assume no duty of confidentiality, express or implied, with respect to any Submission and will have no liability for the use or disclosure of your Submission. Accordingly, Sweet sensation will have no obligation to treat your Submission as confidential or to compensate you or anyone else for your Submission or any use of your Submission by Sweet sensation or others.</p>\r\n<p>Information Sharing Policy: Any information provided to Sweet sensation will not be sold for mailing lists or solicitation Privacy Policy. We may, however, contact you by mail to survey your satisfaction with Sweet sensation or to inform you of new products or promotions at Sweet sensation.</p>\r\n\r\n</div>', '2016-06-16 15:56:36', '2016-06-16 16:11:57', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(20, 'Frequently Asked Questions', 'one_column', NULL, NULL, 'faq', NULL, '<div class="custom_full">\r\n<div class="row other-pages">\r\n<div class="small-12 medium-12 large-12 columns">\r\n<div class="page-title">\r\n<h1>Frequently Asked Questions</h1>\r\n</div>\r\n<p><b>Placing an Order </b></p>\r\n<p>1. How do I place my order?</p>\r\n<ul>\r\n<li>For online orders, go to <a href="http://www.gosensation.com">www.gosensation.com</a> and click on &ldquo;Order Online&rdquo;. Clicks on &ldquo;Our Menu&rdquo; option ,then select your food Options. Click on &ldquo;Add to Chart&rdquo; , Once completed, review your order and click on &ldquo;Place Your Order&rdquo; to finish process.</li>\r\n<li>For over the phone orders, call us at <b>0815 0190 0011</b> to speak to our representatives and they will assist you in placing your order.</li>\r\n<li>Your order will not be processed unless it has been verified via telephone by one of our representative.</li>\r\n</ul>\r\n<p>2. What should I do if I have not received an order confirmation email?</p>\r\n<p>&nbsp;If you haven&rsquo;t received an order confirmation email, please check the spam message in your email or give us a call on <b>0815 0190 0011 </b>to get your order confirmation number.</p>\r\n<p>&nbsp;</p>\r\n<p>Delivery</p>\r\n<p>&nbsp;1. How fast do you deliver?</p>\r\n<p>&nbsp;We deliver in 30 minutes from when you place your order! To check the status of your order, please call us on <b>0815 0190 0011 </b>or visit the &lsquo;My Account&rsquo; and click on &lsquo;Order History&rsquo; to view the status of your order.</p>\r\n<p>2. How do I pay?</p>\r\n<p>You pay the point of delivery via mobile POS or cash! Our drivers do not carry more than #3,000 in cash so please have exact change for your order.</p>\r\n<p>3. Is there a delivery fee or minimum purchased required to make an order?</p>\r\n<p>&nbsp;Delivery fee charge is #100, but during weekdays we have a special delivery fee of #150. The minimum order amount is #1,200.</p>\r\n<p>4. Should I tip the driver?</p>\r\n<p>Our drivers are dedicated to making your delivery experience a delightful one , a delighted customer can appreciate them through tips but its not required.</p>\r\n<p>5. Where do you deliver?</p>\r\n<p>We are currently delivering in <b>Lagos</b> between 8:30am to 5pm every week.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>', '2016-06-16 16:14:39', '2016-06-16 16:14:39', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
